const Paginate = (page, numTasks, nextButton, previewButton) => {

    const pages = Number(numTasks) / 3

    if(1 !== page){
        return <button onClick={previewButton}>Preview</button>
    }

    if(pages.ceil() !== page){
        return <button onClick={nextButton}>Next</button>
    }

}
